import React, { Component } from "react";
import API from "../../../../../utils/API";

class ResultsTable extends Component {
  constructor(props) {
    super(props);
    this.state = {
      equation: {
        num1: {},
        operator: {},
        num2: {},
        result: {},
      },
    };
  }

  componentDidMount = () => {
    API.limit().then((data) => {
      this.setState = {
        equation: data,
      };
    });
  };

  render() {
    return (
      <main className="results-table">
        <ul>
          <li>
            {/* {data.num1} {data.operator} {data.num2} = {data.result} */}
          </li>
        </ul>
      </main>
    );
  }
}
export default ResultsTable;
